const App = () => {
  const course = 'Half Stack application development'
  const part1 = {
    name: 'Fundamentals of React',
    exercises: 10
  }
  const part2 = {
    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }

  const Header = (props) =>{
    console.log(props.course)
    return (
      <div>
        <h1>{props.course}</h1>

      </div>
    )
  }

  const Content = () => {
      return (
        <div>
          <Part course={part1.name} ex={part1.exercises}/>
          <Part course={part2.name} ex={part2.exercises}/>
          <Part course={part3.name} ex={part3.exercises}/>
        </div>
      )
  }

  const Part = (props) => {
    return (
      <div>
        <p>{props.course} {props.ex}</p>
      </div>
    )
  }

  const Total = () => {
    return (
      <div>
        <p>{part1.exercises + part2.exercises + part3.exercises}</p>
      </div>
    )
  }

  return (
    <div>
      <Header course={course}/>
      <Content />
      <Total />
    </div>
  )
}

export default App
